class Command(BaseCommand):
    help = 'Initialise la base de données et injecte le jeu de test principal'

    def add_arguments(self, parser):
        pass

    def handle(self, *args, **options):
        Etat.objects.all().delete()
        for e in etats:
            Etat.objects.create(valeur=e[0], color=e[1], libelle=e[2])
        print("etat ok")

        Job.objects.all().delete()
        for e in jobs:
            Job.objects.create(libelle_job=e[0], valeur_job=e[1], home_job=e[2])
        print("job ok")

        User.objects.all().delete()
        for e in users:
            use = User.objects.create(first_name=e[1], last_name=e[0], email=e[2] + "@gsb.com", username=e[2]
                                      , date_joined=make_aware(datetime(e[7], e[8], e[9]), timezone=None, is_dst=None))
            use.set_password(e[3])
            use.save()

            Profile.objects.create(user=use, adresse=e[4], ville=e[6], cp=e[5], job=Job.objects.get(valeur_job=e[10]))
        print("user ok")

        Forfait.objects.all().delete()
        for e in forfaits:
            Forfait.objects.create(libelle_forfait=e[0], montant=e[1], date_debut=date(e[2], e[3], e[4]))
        for e in forfaits_hist:
            Forfait.objects.create(libelle_forfait=e[0], montant=e[1], date_debut=date(e[2], e[3], e[4]),
                                   date_fin=date(e[5], e[6], e[7]))
        print("forfaits ok")

        FicheFrais.objects.all().delete()
        for e in fiches:
            test = FicheFrais.objects.create(user=User.objects.get(username=e[0]), etat=Etat.objects.get(valeur=e[1]),
                                             date=date(e[2], e[3], e[4]), date_modif=date(e[5], e[6], e[7]),
                                             nb_justificatif=e[8], montant_valide=e[9])
            for i in e[10]:
                LigneFraisHorsForfait.objects.create(fiche_frais=test, etat=Etat.objects.get(valeur=i[0]),
                                                     montant=i[1],
                                                     libelle_hors_forfait=i[2], date_frais=date(i[3], i[4], i[5]),
                                                     date_ajout=date(i[6], i[7], i[8]),
                                                     date_modification=date(i[9], i[10], i[11]))
                for j in e[11]:
                    LigneFraisForfait.objects.create(fiche_frais=test,
                                                     forfait=Forfait.objects.get(libelle_forfait=j[0], date_fin=None),
                                                     etat=Etat.objects.get(valeur=j[1]), quantite=j[2],
                                                     date_frais=date(j[3], j[4], j[5]),
                                                     date_ajout=date(j[6], j[7], j[8]),
                                                     date_modification=date(j[9], j[10], j[11]))
        print("fiches ok")
